import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  state = {
    monsters: [
      {
        name: 'Frankenstain'
      },
      {
        name: 'Dracula'
      },
      {
        name: 'La llorona'
      }
    ]
  };
  render() {
    const { string } = this.state;
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>{string}</p>
          <button onClick={() => this.setState({ monsters: "Bluecatencode" })}>
            Click
          </button>
        </header>
      </div>
    );
  }
}

export default App;
